	render(){
		return(
			<div className = "mainPage container-fluid">
				<h1 className= 'pageName'> Rule </h1>
				<div className='container'>
					<h3>The Basic</h3>
					<h4>Players</h4>
					<p></p>
				</div>
			</div>
		)

	}
}

class Rule extends React.Component{
	render (){
		return (
			<div>
				<Main />
			</div>
		)
	}
}

export default Rule
